import React from 'react';

const Header = ({name, addTodo, onChange, deleteTodo}) => {
  return (
    <header>
    <input value={name} onChange={(e)=> {onChange(e)}}/>
    <button onClick={() => {addTodo()}}>+</button>
    <button onClick={() => {deleteTodo()}}> Trash</button>
    </header>
  )
}

export default Header;
